import React from 'react';
import {useState} from 'react';
import Axios from 'axios';

import './css/main.css';
import './css/general.css';

const TestContainer = (props) => {
    const altText = "Galeriipilt " + props.id;
    return(
        <div key={props.key}>
            <img src={props.img} alt={altText}/>
        </div>
    );
};

const Main = () => {

    const [imageList, setImageList] = useState([]);

    const getImages = () => {
        Axios.get('http://localhost:3001/getimages').catch((error) => {
            if (error.response) {
                console.log(error.response);
            } else if (error.request) {
                console.log(error.request);
            } else {
                console.log("Something else happened");
            }
        }).then((response) => {
            setImageList(response.data);
        });
    }


    return(
        <section className="main">
            <section className="introduction">
                <h1>Mait Jurask</h1>
                <h1>PORTFOLIO</h1>
            </section>
            <section>
                {imageList.map((obj) =>{
                    return(
                        <TestContainer key={obj.id} {... obj}></TestContainer>
                    );
                })}
            </section>
            <section className="about">
                <h6>Mait Jurask</h6>
                <img src="" alt="Signature placeholder"/>
                <button type="button" onClick={() => getImagesClick()}>Contact Me</button>
            </section>
        </section>
    );
};

export default Main;
